import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Image from "material-ui-image";
import Typography from "@material-ui/core/Typography";
import Rating from "@material-ui/lab/Rating";
import Grid from "@material-ui/core/Grid";
import Avatar from "@material-ui/core/Avatar";
const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: "center",
    color: theme.palette.text.secondary,
  },

  text: {
    width: "100%",
    maxWidth: 500,
  },
  image: {
    width: "100%",
  },
}));

export default function Reviews(props) {
  const classes = useStyles();

  return (
    <Grid container spacing={1}>
      <Grid container spacing={1} item xs={12}>
        <Grid item>
          <Avatar />
        </Grid>
        <Grid container spacing={1} item xs={4}>
          <Grid item xs={5}>
            <Rating name="read-only" value={4} readOnly size="small" />
          </Grid>
          <Grid item xs={6}>
            {" "}
            <Typography>11/02/2020</Typography>
          </Grid>
          <Grid item xs={12}>
            <Typography>Dan Balan</Typography>{" "}
          </Grid>
        </Grid>
      </Grid>

      <Grid item xs={12}>
        <Typography>Cassette roks!</Typography>
      </Grid>
      <Grid item xs={12}>
        <Typography>
          Once I got the legend pro on my hand, I totally feel like my previous
          couple pairs of O brand shades are over priced! So far in a month of
          usage, I'm pretty happy with the purchase. The glasses feel sturdy and
          look good. Don't know how well the scratch resistance is yet, but they
          provided you a lifetime warranty so I'm not too worry about it.{" "}
        </Typography>{" "}
      </Grid>
    </Grid>
  );
}
